import React, { Component } from 'react';
import axios from 'axios';
import './loginn.css';



class Registro extends Component {
    state = {
        email: '',
        password: '',
        name: '',
        userType: 'artista', // Valor padrÃ£o para artista
        message: '',
    };

    handleChange = (e) => {
        this.setState({ [e.target.name]: e.target.value });
    };

    handleRegister = async () => {
        const { email, password, name, userType, document, telefone } = this.state;
        var data = {};
        try {
            let response;
            if (userType === 'artista') {
               // data = { "user": { "name": "teste", "email": "teste@teste18.com", "password": "teste", "pic": "teste", "telefone": "43434" } };
                data = { "user": { email, password, name, "pic": "0", "telefone": telefone } };

                response = await axios.post(process.env.REACT_APP_API + '/user/RegisterArtista', data);
            } else {
               // data = { "document": "43802329805", "user": { "name": "teste", "email": "teste@teste18.com", "password": "teste", "pic": "teste", "telefone": "43434" } };
                data = { "document": document, "user": { email, password, name, "pic": "0", "telefone": telefone } };
                console.log(data);
                response = await axios.post(process.env.REACT_APP_API + '/user/RegisterCliente', data);
            }

            const result = response.data;
            if (result.success) {
                this.setState({ message: result.sucesso });
            } else if (result.error) {
                this.setState({ message: result.erro });
            }
        } catch (error) {
            console.error(error);
        }
    };

    render() {
        const { email, password, name, userType, message, document, telefone } = this.state;

        return (

            <div class="container">
                <div class="form-image">
                    <div class="texto">
                        <h1>Bem Vindo!</h1>
                        <br/>
                            <p>Realize o Login para acessar sua conta <br/>ou Cadastre-se gratuitamente.</p>
                    </div>
                </div>

                <div class="form">
                    <form>
                        <div class="form-header">
                            <div class="title">
                                <h1>Cadastre-se</h1>
                            </div>
                        </div>

                        <div class="input-group">
                            <div class="input-box">
                                <label for="firstname">Primeiro Nome</label>
                                <input id="firstname" type="text" name="name" value={name} onChange={this.handleChange} placeholder="Digite seu primeiro nome" required/>
                            </div>
                        

                        <div class="input-box">
                            <label for="email">E-mail</label>
                            <input id="email" type="email" name="email" value={email} onChange={this.handleChange} placeholder="Digite seu e-mail" required/>
                        </div>

                        <div class="input-box">
                            <label for="telefone">Celular</label>
                            <input id="telefone" type="tel" name="telefone" value={telefone} onChange={this.handleChange} placeholder="(xx) xxxx-xxxx" required/>
                        </div>

                        <div class="input-box">
                            <label for="password">Senha</label>
                            <input id="password" type="password" name="password" value={password} onChange={this.handleChange} placeholder="Digite sua senha" required/>
                        </div>

                        <div class="input-box">
                            <label for="password">Senha</label>
                            <select name="userType" value={userType} onChange={this.handleChange}>
                                <option value="artista">Artista</option>
                                <option value="cliente">Cliente</option>
                            </select>
                        </div>

                        <div class="input-box">
                            {userType === 'cliente' && (
                                <><label for="document">Senha</label>
                                    <input id="document" type="text" name="document" value={document} onChange={this.handleChange} placeholder="Digite seu documento" required /></>
                            )}
                        </div>

                        <div class="continue-button">
                            <button onClick={this.handleRegister}>Registrar</button>
                        </div>
                        <p>{message}</p>
                        </div>
                    </form>

                </div>
            </div>
        );
    }
}

export default Registro;
